import React, { useState } from 'react';
import Teamimages from "./ImageDirectories/TeamImageDirectory/Teams.json"
import {useLocation} from 'react-router-dom'
import iams from "images/Carousel_Images/16_team_photos/TeamPhotos/God's_Vineyard_FC/PXP-0093.jpg"
const myImage = "images/Carousel_Images/16_team_photos/TeamPhotos/God's_Vineyard_FC/PXP-0093.jpg"

function App() {
  let newImage;
  let AllTeamImages = []
    for(let i = 0 ; i < Teamimages.length; i++){
      if(Teamimages[i].team.includes("God's Vineyard")){
        newImage = Teamimages[i].url
        AllTeamImages.push(newImage)
      }
    }
    console.log(AllTeamImages)
    
  return (
    <div className="flex flex-wrap justify-center">
      {AllTeamImages.map((image, index) => (
        <div key={index}>
          <img
            src={image}
            className="w-96 h-96 m-4"
          />
        </div>
      ))}
      <img src={myImage} className='w-4 h-4'/>
    </div>
  );
}

export default App;
